import React, {useState} from 'react';
import 'react-slideshow-image/dist/styles.css'
import { Slide } from 'react-slideshow-image';
import axios from 'axios';
import './styles.css';

var Album = () => {
    const slideImages = [
        {
          url: 'slide1.png',
          caption: 'Slide 1'
        },
        {
          url: 'slide2.png',
          caption: 'Slide 2'
        },
        {
          url: 'slide4.jpg',
          caption: 'Slide 3'
        },
      ];
    return (
        <div>
            <div className="slide-container">
        <Slide>
            <div className="each-slide">
              <img src="https://www.sirvisual.com/Attachment/100/4321_30419_80-595%20Principale.jpg" />
            </div>
            <div className="each-slide">
              <img src="https://www.cabinetmakerwarehouse.com/wp-content/uploads/969-navy-blue.jpg" />
            </div>
            <div className="each-slide">
              <img src="./slide3.jpg" />
            </div>
        </Slide>
      </div>
        </div>
    );
}

export default Album;
